import React from "react";

const handleLogout = () => {
  localStorage.removeItem("user-data");
  setIsLoggedin(false);
};
const logout = () => {
  return (
    <div>
      <button onClick={handleLogout()}></button>
    </div>
  );
};

export default logout;
